import './App.css';
import Expense from './compenents/Expense.js';
// import { Component } from 'react';

function  App(){
  const data=[
    {id:"el1",title:"toilet paper",amount:283,data:new Date()},
    {id:"el2",title:"new tv",amount:383,data:new Date()},
    {id:"el3",title:"car insurance",amount:483,data:new Date()},
    {id:"el4",title:"new desk",amount:583,data:new Date()}
  ]
  return (
    <div className='app-expense'>
      <h2>let start</h2>
      <Expense data={data}></Expense>
    </div> )  
}
export default App;
